INSERT INTO `mdl_scale` VALUES (1,0,0,'Formes de coneixement separades i connectades','Sobretot coneixements separats,Separats i connectats,Sobretot coneixements connectats','L\'escala basada en la teoria del coneixement separat i connectat.\nAquesta teoria descriu dues formes diferents d\'avaluar i aprendre sobre les coses que podem veure i escoltar.<ul><li>Els <strong>coneixedors separats</strong> intenten mantenir-se objectius sense deixar-se influir pels sentiments ni les emocions. En la discussió amb altres persones els agrada defensar les seves idees utilitzant la lògica per trobar forats en l\'argumentació de l\'oponent.</li><li>Els <strong>coneixedors connectats</strong> són molt més sensibles que la resta de la gent. Són experts en empatia i tendeixen a escoltar i fer preguntes fins que poden «entendre el teu punt de vista». Aprenen provant de compartir les experiències que els han aportat coneixement amb la resta de la gent.</li></ul>',0,1620395662),(2,0,0,'Escala de competència per defecte','No és competent encara,Competent','Una escala de qualificació binària que no ofereix informació més enllà de algú ha demostrat assoliment o no.',0,1620395662);
/*!40000 ALTER TABLE `mdl_scale` ENABLE KEYS */;
